import React, { useState, useEffect } from "react";
import API from "../../API/api";

export default function CPA() {
  const [employees, setEmployees] = useState([]);
  const [scheduleData, setScheduleData] = useState({});
  const today = new Date();
  const year = today.getFullYear();
  const month = today.getMonth();
  const endDate = new Date(year, month + 1, 0).getDate();

  const firstHalfDates = Array.from(
    { length: Math.min(15, endDate) },
    (_, i) => new Date(year, month, i + 1)
  );
  const secondHalfDates = Array.from(
    { length: endDate - 15 },
    (_, i) => new Date(year, month, i + 16)
  );

  useEffect(() => {
    const fetchData = async () => {
      const token = localStorage.getItem("token");
      try {
        const empRes = await API.get("/employee/employeeList", {
          headers: { Authorization: `Bearer ${token}` },
        });
        setEmployees(empRes.data);

        const scheduleRes = await API.get("/schedule/tipList", {
          headers: { Authorization: `Bearer ${token}` },
        });

        const mappedSchedule = {};
        scheduleRes.data.forEach((item) => {
          const dateObj = new Date(item.date);
          const key = `${dateObj.getMonth() + 1}/${dateObj.getDate()}`;
          mappedSchedule[key] = {
            AM: { hourly: item.AM?.hourly || 0, tip: item.AM?.tipTotal || 0 },
            PM: { hourly: item.PM?.hourly || 0, tip: item.PM?.tipTotal || 0 },
          };
        });

        setScheduleData(mappedSchedule);
      } catch (err) {
        console.error(err);
      }
    };
    fetchData();
  }, []);

  const renderTable = (dates) => {
    return employees.map((emp) => (
      <div key={emp._id} className="overflow-x-auto mb-6 border rounded shadow">
        <div className="grid grid-cols-[150px_80px_repeat(auto-fit,minmax(80px,1fr))]">
          <div className="border px-2 py-1 font-bold bg-gray-100 sticky left-0 z-10">
            {emp.name}
          </div>
          <div className="border px-2 py-1 font-bold bg-gray-100 sticky left-[150px] z-10">
            {emp.hourlyPay}
          </div>
          {dates.map((date) => (
            <div
              key={date}
              className="border px-1 py-1 text-center font-bold bg-gray-200"
            >
              {`${date.getMonth() + 1}/${date.getDate()}`}
            </div>
          ))}

          {dates.map((date) => {
            const key = `${date.getMonth() + 1}/${date.getDate()}`;
            const am = scheduleData[key]?.AM || {};
            const pm = scheduleData[key]?.PM || {};
            return (
              <React.Fragment key={`ampm-${key}`}>
                <div className="border px-1 py-1 text-center">AM</div>
                <div className="border px-1 py-1">PM</div>
              </React.Fragment>
            );
          })}

          {dates.map((date) => {
            const key = `${date.getMonth() + 1}/${date.getDate()}`;
            const am = scheduleData[key]?.AM || {};
            const pm = scheduleData[key]?.PM || {};
            return (
              <React.Fragment key={`values-${key}`}>
                <div className="border px-1 py-1 grid grid-cols-2 text-center">
                  <span>{am.hourly}</span>
                  <span>{am.tip}</span>
                </div>
                <div className="border px-1 py-1 grid grid-cols-2 text-center">
                  <span>{pm.hourly}</span>
                  <span>{pm.tip}</span>
                </div>
              </React.Fragment>
            );
          })}
        </div>
      </div>
    ));
  };

  return (
    <div className="p-6 max-w-full mx-auto">
      {renderTable(firstHalfDates)}
      {renderTable(secondHalfDates)}
    </div>
  );
}
